    <script type="text/javascript">
        var tx = 5, ty = 15, useAccelerometer = true;

/* requestAnimationFrame polyfill: */
window.requestAnimationFrame = (function () {
  return window.webkitRequestAnimationFrame || window.mozRequestAnimationFrame ||
                  window.oRequestAnimationFrame || window.msRequestAnimationFrame ||
                  function (callback, element) { window.setTimeout(callback, 1000 / 60); };
})();

function init() {
  var SPEED = 0.2;
  var BRAKES = 0.25;
  var viewport = document.getElementById("viewport");
  var cube = document.getElementById("spin-y");
  var orientation = 1;

  var hasGyro = navigator.userAgent.match(/iPad|iPhone|iPod|BlackBerry/i) != null
                  || screen.width <= 480;
  useAccelerometer = hasGyro;  //initially turn off gyro for Android uses (bad support) 

  var isMobile = navigator.userAgent.match(/iPad|iPhone|iPod|Android|BlackBerry/i) != null
                  || screen.width <= 480;
  if (!isMobile) {
    var accelerometer = document.getElementById("acce");
    accelerometer.style.display = 'none';
  }
  var x = y = rx = ry = ox = oy = dx = dy = 0;
  var isMouseDown = false;
  viewport.onmousedown = viewport.ontouchstart = function (evt) {
    evt.preventDefault();
    isMouseDown = true;
    var tap = (isMobile) ? evt.touches[0] : evt;
    x = tap.pageX * SPEED;
    y = tap.pageY * SPEED / 2;
  };

  viewport.onmouseup = viewport.ontouchend = function () {
    isMouseDown = false;
  }

  viewport.onmousemove = viewport.ontouchmove = function (evt) {
    evt.preventDefault();
    var tap = (isMobile) ? evt.touches[0] : evt;
    if (!isMobile && !isMouseDown) return;
    tx += tap.pageX * SPEED - x;
    ty -= tap.pageY * SPEED / 2 - y;
    x = tap.pageX * SPEED;
    y = tap.pageY * SPEED / 2;
  }

  if (isMobile) {
    window.onorientationchange = function (evt) {
        evt.preventDefault();
        orientation = ( window.orientation == 90 || window.orientation == -90 ) ? 1:0;
    }    

    window.ondeviceorientation = function (evt) {
      evt.preventDefault();
      if (!useAccelerometer) return;
      var alpha = orientation === 1 ? evt.alpha : evt.alpha;
      var gamma = orientation === 1 ? evt.gamma : ((Math.abs(evt.gamma) > 80));
      if ((ox == 0) && (oy == 0)) {
        ox = alpha;
        oy = gamma;
      }
      ox += alpha - ox;
      oy += gamma - oy;
    }
  }

  function tick(timestamp) {
    requestAnimationFrame(tick);
    if ((ox + tx - rx) > 100) { tx -= 360; }
    if ((ox + tx - rx) < -100) { tx += 360; }
    rx += (ox + tx - rx) * BRAKES / 2;
    ry += (oy + ty - ry) * BRAKES;
    cube.style.webkitTransform = "rotateX(" + (-ry) + "deg) rotateY(" + (-rx) + "deg)";
    cube.style.MozTransform = "rotateX(" + (-ry) + "deg) rotateY(" + (-rx) + "deg)";
  }

  tick(0);
}

        #toolbar {

    position: absolute;
    width: 99%;
    height: 100%;

    perspective: 600px;

    position: relative;

    margin: 0 auto;

    -Moz-transform-style: preserve-3d;

    top: -499px;
    left: -499px;
    display: block;

    position: absolute;
